package AssignDay8;

public class BoxUnboxingExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		    int a=50;  
	        Integer a2=new Integer(a);//Boxing  
	  
	        Integer a3=5;//Boxing  
	          
	        Integer i=new Integer(50);  
	        int a1=i;  //unboxing
	          
	        System.out.println(a1);   
	        System.out.println(a2+" "+a3);  
	}

}
